pragma solidity ^0.5.0;

import "./zeppelin/Ownable.sol";



contract apesCustomerInterface{
    function checkIfBussinessIdExist(uint64)public view returns (uint32);
}


contract Invoice is Ownable{



  uint private idDigits = 16;
  uint private idModulus = 10 ** idDigits;

  struct Invoice{
    uint date;
    uint64 apesCustomer;
    string destName;
    string destPhone;
    string destCountry;
    string destCity;
    string destDeliverAddress;
    string destDate;
  }

  apesCustomerInterface  apesCustomerContract;

  Invoice[] public transactionInvoices;

  mapping ( uint => uint ) public invoices;

  uint[] public keys;

    function setApesCustomerContractAddress(address _address) public onlyOwner  {
      apesCustomerContract = apesCustomerInterface(_address);
    }

    function getApesCustomerContractAddress() public view onlyOwner returns (apesCustomerInterface) {
      return apesCustomerContract;
    }

    event customIdGenerated(uint transactId);

    event invoiceGenerated(uint64  _customer, string   _destName, string  _destPhone,
         string  _destCountry, string _destCity, string _destDeliverAddress,
         uint date, uint transactionId);


    function generateInvoice(uint64  _customer, string memory  _destName, string memory  _destPhone,
         string memory  _destCountry, string memory  _destCity, string memory  _destDeliverAddress,
         string memory  _destDate
    ) public onlyOwner returns (uint){

      uint32 checkifExist = apesCustomerContract.checkIfBussinessIdExist(_customer);

      require (checkifExist != 0);

      uint rand = _generateRandomId(_destDeliverAddress);

      /*uint invoice = invoices[rand];
      require (invoice == 0);*/

      Invoice memory invoice = Invoice({
        date:now,
        apesCustomer:_customer,
        destName:_destName,
        destPhone: _destPhone,
        destCountry: _destCountry,
        destCity: _destCity,
        destDeliverAddress: _destDeliverAddress,
        destDate: _destDate
      });

      transactionInvoices.push(invoice);

      invoices[rand] = transactionInvoices.length;

      keys.push(rand);

      emit customIdGenerated(rand);

      emit invoiceGenerated(invoice.apesCustomer, invoice.destName, invoice.destPhone, invoice.destCountry,
      invoice.destCity, invoice.destDeliverAddress, invoice.date, rand );

      return rand;

   }

    function _generateRandomId(string memory _str) private view returns (uint) {
        uint rand = uint(keccak256(abi.encodePacked(now,_str)));
        return rand % idModulus;
    }

    function totalTransactions() public view returns (uint)
    {
        return transactionInvoices.length;
    }


    function checkifTransactIdExist(uint transactId) public view returns (uint){
        return invoices[transactId];
    }


}
